import React from 'react';
import logo from './UI/logo.png';
import { Link } from 'react-router-dom';

function Header({ setModal }) {
    const isAuth = true;
    return (
        <div className='header'>
        <div className='logo'>
          <img src={logo} />
        </div>
            <div className='menu'>
                {isAuth ? <div><Link className='links' to='/'>
            Main Page
          </Link>
          <Link to='/registration'>
            <button>Registration</button>
          </Link>
          <button onClick={() => setModal(true)}>Login</button></div> : <button>Account</button>}
        </div>
      </div>)
}

export default Header;
